			if(TLConfig.onPC){
				Laya.stage.scaleMode="full";
			}
			else{
				Laya.stage.scaleMode="fixedwidth";
				Laya.stage.screenMode="horizontal";
			}
			this._players=[];
			this._net=new NetConnection();
			Laya.stage.on("keydown",this,this.onKeyDown);
			Laya.stage.on("keyup",this,this.onKeyUp);
