		__proto.EncodeBitBuf=function(src,dest){
			this.EncodeBitMasks[3]=0x85;
			this.EncodeBitMasks[15]=0xBC;
			this.EncodeBitMasks[31]=0xC9;
			this.EncodeBitMasks[63]=0x89;
			this.EncodeBitMasks[127]=0x6D;
			this.EncodeBitMasks[255]=0xD1;
			var I=0;
			var nRestCount=0;
			var nDestPos=0;
			var btMade=0;
			var btCh=0;
			var btRest=0;
			var btIdx=0;
			var nSrcLen=src.length;
			if (!dest)return;
			var dst=dest;
			var nDestLen=10000;
			dst.length=nDestLen;
			for(I=0;I < nSrcLen;I++){
				if(nDestPos >=nDestLen)
					break ;
				btCh=src.__get(I);
				btIdx=I % 256;
				btCh=btCh ^ this.EncodeBitMasks[btIdx] ^ this.EncodeBitMasks[255-btIdx];
				btMade=0xFF & ((btRest | (btCh >> (2+nRestCount)))& 0x3F);
				btRest=0xFF & (((btCh << (8-(2+nRestCount)))>> 2)& 0x3F);
				nRestCount+=2;
				if(nRestCount < 6){
					dst.__set(nDestPos,btMade+0x3C);
					nDestPos++;
				}
				else{
					if(nDestPos < nDestLen-1){
						dst.__set(nDestPos,btMade+0x3C);
						dst.__set(nDestPos+1,btRest+0x3C);
						nDestPos+=2;
					}
					else{
						dst.__set(nDestPos,btMade+0x3C);
						nDestPos++;
					}
					nRestCount=0;
					btRest=0;
				}
			}
			if(nRestCount > 0){
				dst.__set(nDestPos,btRest+0x3C);
				nDestPos++;
			}
			dst.length=nDestPos;
			dest.pos=0;
		}

