				var areaRow=3;
				var startCol=col-areaCol;
				var endCol=col+areaCol;
				var startRow=row-areaRow;
				var endRow=row+areaRow;
				if(startCol < 0)startCol=0;
				if(startRow < 0)startRow=0;
				if(endCol >=25)endCol=25-1;
				if(endRow >=25)endRow=25-1;
